import React from 'react';
import Navbar from '../Components/Navbar';
import Footer from '../Components/Footer';
import Cform from '../Components/Cform';
export default function Contact() {
  return (
    <div className='contact'>
      <Navbar/>
      <Cform/>
      <Footer/>
    </div>
  )
}
